<template>
  <button @click="createPDF" 
  class="border-2 rounded transition text-2xl duration-300 ease-in-out text-center mr-auto ml-auto border-black w-40 h-14 bg-yellow-500 text-black cursor-pointer hover:bg-white m-4">
    Create PDF
  </button>
</template>

<script setup>
const props = defineProps({
    id: {}
});
import { generate } from "@pdfme/generator";
import useCompanies from "../../services/companyservices";
const { getCompany, company } = useCompanies();
await getCompany(props.id);

let concatPeople = "";
if (company.value.people[0]) {
  company.value.people.forEach(person => {
    const name = person.firstname + ' ' + person.lastname;
    concatPeople = concatPeople + name + ', '
  });
}
if (concatPeople == "") {
  concatPeople = 'none'
}
const people = concatPeople;

let concatSectors = "";
if (company.value.activitysectors[0]) {
  company.value.activitysectors.forEach(activitysector => {
    concatSectors = concatSectors + activitysector.name + ', '
  });
}
if (concatSectors == "") {
  concatSectors = 'none'
}
const activitysectors = concatSectors;


const createPDF = async () => {
  
  const template = {
  "schemas": [
    {
      "city": {
        "type": "text",
        "position": {
          "x": 39.97,
          "y": 104.58
        },
        "width": 91.27,
        "height": 6.12,
        "fontSize": 16
      },
      "CA": {
        "type": "text",
        "position": {
          "x": 42.35,
          "y": 115.85
        },
        "width": 53.96,
        "height": 6.12,
        "fontSize": 16
      },
      "people": {
        "type": "text",
        "position": {
          "x": 33.65,
          "y": 227.12
        },
        "width": 43.38,
        "height": 6.12,
        "fontSize": 16
      },
      "postalcode": {
        "type": "text",
        "position": {
          "x": 62.23,
          "y": 93.26
        },
        "width": 100.25,
        "height": 6.12,
        "fontSize": 16,
        "lineHeight": 1
      },
      "activitysectors": {
        "type": "text",
        "position": {
          "x": 32.01,
          "y": 160.86
        },
        "width": 91.35,
        "height": 7,
        "alignment": "left",
        "fontSize": 16,
        "characterSpacing": 0,
        "lineHeight": 1
      },
      "name": {
        "type": "text",
        "position": {
          "x": 20.91,
          "y": 58.47
        },
        "width": 170.19,
        "height": 21.02,
        "alignment": "center",
        "fontSize": 44,
        "characterSpacing": 0,
        "lineHeight": 1
      }
    }
  ],
  "basePdf": "data:application/pdf;base64,"
  };
  
  const inputs = [
    {
      "city": company.value.city,
      "CA": company.value.CA,
      "people": people,
      "postalcode": company.value.postalcode,
      "activitysectors": activitysectors,
      "name": company.value.name
    }
  ];

  const pdf = await generate({ template, inputs });

  // Node.js
  // fs.writeFileSync(path.join(__dirname, 'test.pdf'), pdf);

  // Browser
  const blob = new Blob([pdf.buffer], { type: 'application/pdf' });
  window.open(URL.createObjectURL(blob));
}



</script>